INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (0.0, "リン", 24, "2030/12/17 14:59:59", 24001, 1, "あたしだって\nやるときはやるよ！", 0.0, 10040, 1, "2020/04/30 12:00:00", 0, 0.0, 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (0.0, "リン", 24, "2030/12/17 14:59:59", 24002, 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", 0.0, 10040, 1, "2020/04/30 12:00:00", 1, 0.0, 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (0.0, "リン", 24, "2030/12/17 14:59:59", 24003, 1, "終わった終わった\n一人でもなんとか\nなるもんだね", 0.0, 10040, 1, "2020/04/30 12:00:00", 2, 0.0, 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (0.0, "リン", 24, "2030/12/17 14:59:59", 24004, 2, "やったね！\nこれでようやく\nサボれるよ…", 0.0, 10040, 2, "2020/04/30 12:00:00", 3, 0.0, 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (0.0, "リン", 24, "2030/12/17 14:59:59", 24005, 1, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 0.0, 10040, 1, "2020/04/30 12:00:00", 4, 0.0, 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (0.0, "リン", 24, "2030/12/17 14:59:59", 24006, 2, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 0.0, 10040, 2, "2020/04/30 12:00:00", 5, 0.0, 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (0.0, "リン", 24, "2030/12/17 14:59:59", 24007, 2, "あたしも意外と\nやるもんでしょ？", 0.0, 10040, 2, "2020/04/30 12:00:00", 6, 0.0, 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (0.0, "リン", 24, "2030/12/17 14:59:59", 24008, 4, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 0.0, 10040, 4, "2020/04/30 12:00:00", 7, 0.0, 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (0.0, "リン", 24, "2030/12/17 14:59:59", 24009, 4, "このままじゃ\nまっひ～に\n叱られちゃうよ", 0.0, 10040, 4, "2020/04/30 12:00:00", 8, 0.0, 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (0.0, "リン", 24, "2030/12/17 14:59:59", 24010, 4, "まじめに\nやったんだけどな…\n悔しいな～", 0.0, 10040, 4, "2020/04/30 12:00:00", 9, 0.0, 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (0.0, "リン", 24, "2030/12/17 14:59:59", 24011, 4, "やられた…\nねずみって意外と\nてごわいね", 0.0, 10040, 4, "2020/04/30 12:00:00", 10, 0.0, 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (0.0, "リン", 24, "2030/12/17 14:59:59", 24012, 4, "おのれ～\nあたしのチーズを\n盗みやがって～！", 0.0, 10040, 4, "2020/04/30 12:00:00", 11, 0.0, 102601);
INSERT INTO `v1_f3f2d6e3524dcebb4d6e846bd6ae660be1efc427438af33a168babf35b8c6430` VALUES (0.0, "リン", 24, "2030/12/17 14:59:59", 24013, 4, "疲れた…\nけど、次こそは\n守り抜くよ…", 1.81, 10040, 1, "2020/04/30 12:00:00", 12, 0.0, 102601);
